css:
.block-navbar {
  width: 100% !important;
  max-width: initial !important;
  background: #444;
  color: #fff;
}
.block-navbar nav.navbar {
  background: none;
  color: currentColor;
}
.block-navbar > .inner {
  width: 100% !important;
  max-width: initial !important;
  margin: 0 !important;
}
.block-navbar nav.navbar li.nav-item a.nav-link {
  color: currentColor;
}
.block-navbar nav.navbar .navbar-brand {
  color: currentColor;
}
